def get_results_by_dirs(dirs):
    df = pd.DataFrame()
    if isinstance(dirs, str):
        dirs = [dirs]
    for rt in np.sort(dirs):
        for run_root, dirs, files in os.walk(rt.encode('utf-8')):
            if len(run_root) == 0:
                continue
            res_csv = os.path.join(run_root, 'log/res.csv'.encode('utf-8')).decode()
            if not os.path.exists(res_csv):
                continue
            print('handling {}'.format(res_csv))
            rs = pd.read_csv(res_csv)
            rs.loc[:, 'src'] = run_root
            df = pd.concat([df, rs], ignore_index=True)
    # df = df.fillna(0)
    return df


